PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
ASK {
  VALUES ( ?player1 ?player2 ?yearStart ?yearEnd ) {
    ( wd:Q169452 wd:Q25369 "2000-01-01T00:00:00Z" ^^ xsd:dateTime "2000-12-31T23:59:59Z" ^^ xsd:dateTime )
  }
  ?player1 p:P54 ?stmt1 .
  ?stmt1 ps:P54 ?team ; pq:P580 ?start1 .
  OPTIONAL {
    ?stmt1 pq:P582 ?end1 .
  }
  FILTER ( ?start1 <= ?yearEnd && ( ! BOUND( ?end1 ) || ?end1 >= ?yearStart ) ) ?player2 p:P54 ?stmt2 .
  ?stmt2 ps:P54 ?team ; pq:P580 ?start2 .
  OPTIONAL {
    ?stmt2 pq:P582 ?end2 .
  }
  FILTER ( ?start2 <= ?yearEnd && ( ! BOUND( ?end2 ) || ?end2 >= ?yearStart ) )
}

