SELECT ?person ?personLabel ( COUNT( DISTINCT ?award ) AS ?count ) WHERE {
  VALUES ?person {
    wd:Q41421 wd:Q25369
  }
  .
  ?person wdt:P166 ?award .
  ?award rdfs:label ?awardLabel .
  FILTER ( LANG( ?awardLabel ) = "en" && ( CONTAINS( ?awardLabel , "NBA" ) || CONTAINS( ?awardLabel , "National Basketball Association" ) ) ) .
